/** @format */

import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import MessageBox from '../components/MessageBox';

function AddFarm(props) {
	const [farmType, setFarmType] = useState('');

	const dispatch = useDispatch();
	const submitHandler = (e) => {
		e.preventDefault();
		dispatch(farmType);
	};
	return (
		<>
			<div className="container ">
				<div className="farm-form">
					<div className="row">
						<div className="col-md-3"></div>
						<div className="col-md-6">
							<div>
								{/* {error && <MessageBox variant="danger"></MessageBox>} */}
								{/* {userInfo && (
								<MessageBox variant="success">
									Registration is successful, Please fill in your Location.
								</MessageBox>
							)} */}
								<p className="text-center">SELECT A FARM TYPE</p>
								<form onSubmit={submitHandler}>
									<div className="form-group input-group" id="mobileNumber">
										<select
											class="custom-select custom-select-lg mb-3"
											onChange={(e) => setFarmType(e.target.value)}
											placeholder="Select a Farm Type"
										>
											<option selected>Select a Farm Type</option>
											<option value="Poultry Farming">Poultry Farming</option>
											<option value="Crop Farming">Crop Farming</option>
											<option value="Fish Farming">Fish Farming</option>
										</select>

										{setFarmType === 'Poultry' ? (
											<div>
												<select
													class="custom-select custom-select-lg mb-3"
													onChange={(e) => setFarmType(e.target.value)}
													placeholder="Select a Farm Type"
												>
													<option selected>Select a Farm Type</option>
													<option value="Poultry Farming">Poultry Farming</option>
													<option value="Crop Farming">Crop Farming</option>
													<option value="Fish Farming">Fish Farming</option>
												</select>
											</div>
										) : (
											<div></div>
										)}
										{/* <input
										name=""
										className="form-control"
										placeholder="Phone number"
										type="button"
										onChange={(e) => setPhone(e.target.value)}
										required={true}
									/> */}
									</div>

									<div className="form-group">
										<button
											type="submit"
											className="btn btn-primary btn-block"
											onClick={submitHandler}
										>
											PROCEED
										</button>
									</div>
								</form>
							</div>
						</div>
						<div className="col-md-3"></div>
					</div>
				</div>
			</div>
		</>
	);
}

export default AddFarm;
